import {
  Grid,
  Card,
  CardContent,
  CardActions
} from "@mui/material";

const Congratulation = ()=>{
  const design = (
    <>
      <Grid item>
      <Card>
      <CardContent></CardContent>
      <CardActions></CardActions>
      <h1>Congratulations</h1>
      </Card>
      </Grid>
    </>
  );
  return design;
}

export default Congratulation;
